import React from 'react';
import './TileCard.css'

const TileCard = ({ title, description, image }) => {
    return (
        <div style={{ textAlign: 'center', width: '200px', padding: '10px', boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)', borderRadius: '5px' }}>
            <img src={image} alt={title} style={{ width: '100%', height: '150px', objectFit: 'cover', borderRadius: '5px' }} />
            <h2 style={{ fontSize: '1.1rem', fontWeight: 'bold' }}>{title}</h2>
            <p>{description}</p>
            <button style={{ backgroundColor: 'black', color: 'white', padding: '10px 20px', borderRadius: '5px', marginTop: '10px' }}>
                View more
            </button>
        </div>
    );
};

export default TileCard;
